const meals = [{
    name: 'Phet', dates: [2010], type: 'cyclone', area: 'Northern Indian'
  },
  {
    name: 'Eleanor', dates: [2018], type: 'storm', area: 'Atlantic'
  }
];

const Input = styled.input`
  margin: 1rem 0;
  background: none;
  border: none;
  border-radius: 2px;
  border: 2px solid #ffffff22;
  padding: 0.5rem 1rem;
  color: #fff;

  &::placeholder {
    font-family: inherit;
    color: inherit;
    opacity: 0.5;
`;

const AppInput = (props) => {
    return(
        <div className="AppInput">
            <input type="text" placeholder='Lasagnia'
            value={props.input} onChange={props.handleInput}/>

        </div>
    )
}
